$('a[href*=#]:not([href=#])').click(function() {
	if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
		var target = $(this.hash);
		target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
		if (target.length) {
			$('html,body').animate({
				scrollTop: target.offset().top -51
			}, 1000);
			return false;
		}
	}
});

$(window).on("scroll", function() {
	if ($(this).scrollTop() > 100) {

		$(".img-tab").css("width", "47px");
		$(".nav").css("margin", "4px 0 0 0");
		$( "#nav" ).addClass( "add-gradient" );
	}
	else {

		$(".img-tab").css("width", "72px");
		$(".nav").css("margin", "11px 0 0 0");
		$( "#nav" ).removeClass( "add-gradient" );
	}

	var topWindow = $(window).scrollTop();
	var topWindow = topWindow * 1.5;
	var windowHeight = $(window).height();

	var position = topWindow / windowHeight;
	position = 1 - position;

$('.arrow-wrap, #feature').css('opacity', position);
});

$(function() {
	$('#feature-wrap').css({
		'margin-top' : ($(window).height()/2) - ($("#feature").height() / 2),
		'margin-left' : ($(window).width()/2) - ($("#feature").width() / 2)
	});

	$(window).resize(function(){
		$('#feature-wrap').css({
			'margin-top' : ($(window).height()/2) - ($("#feature").height() / 2),
			'margin-left' : ($(window).width()/2) - ($("#feature").width() / 2)
		});
	});

});

var faderz = ('#nav, #feature');
$(window).load(function() {
	$(faderz).css({opacity: 0.0, visibility: "visible"}).animate({opacity: 1.0},400);
});

